import React from "react"

const Nav = (func, descr, home) => {
    if (home !== "True"){
        return(
            <div className="w-4/5 flex mx-auto">
                <img src="https://via.placeholder.com/200x60" alt="" className="m-4"/>
                <div className="flex-1 w-12"></div>
                <button className="border-pink-600 border-2 font-bold rounded-full float-right m-4 py-3 px-6 text-pink-400 hover:bg-pink-600 hover:border-pink-600 hover:text-white" onClick={func}>{descr}</button>
            </div>   
    )} else {
        return(
            <div className="nav">
                <button className="border-pink-600 border-2 font-bold rounded-full float-right m-4 py-3 px-6 text-pink-400 hover:bg-pink-600 hover:border-pink-600 hover:text-white" onClick={func}>Sign in.</button>
            </div>
        )
    }
}

export default Nav
